import React, { useEffect } from 'react';
import Aos from "aos";
import "aos/dist/aos.css";
import ProjectCard from '../components/ProjectCard';

function ProjectsScreen(){

    useEffect(() => {
        Aos.init({duration: 2000, once: true});
    }, []);

    return (
        <div>
            <div className="sub-page-title-section" data-aos="fade-left">
                <h1>Personal projects</h1>
            </div>

            <div class="list">
                <ProjectCard 
                    title="Currency Converter"
                    tags={['Java']}
                    text="A small Java project created so I could improve my Java skills. It uses live exchange rates to convert between currencies"
                    toPath="https://github.com/fergorgs/Currency-Converter"
                    fadeUp={true}
                />
                <ProjectCard 
                    title="Movie Info App"
                    tags={['Flutter', 'Dart']}
                    text="An app created to practice my Flutter skills. It fetches data 
                    Fetches and displays information about movies from the web"
                    toPath="https://github.com/fergorgs/Movie-Info-App"
                    fadeUp={true}
                />
                <ProjectCard 
                    title="Petshop website"
                    tags={['React', 'HTML', 'CSS', 'JavaScript', 'Node.js', 'MongoDB']}
                    text="A petshot website made as a Web class assigment."
                    toPath="https://github.com/fergorgs/WebProject"
                    fadeUp={true}
                />
                <ProjectCard 
                    title="This website!"
                    tags={['React', 'HTML', 'CSS', 'JavaScript']}
                    text="This website was created using React. It serves both as a portifolio complement and a personal website :)! The source code is avalible at github"
                    toPath=""
                    fadeUp={true}
                />
            </div>
        </div>
    );
}

export default ProjectsScreen;
